@font-face {
    font-family: 'Ahem';
    src: url('file:///Users/jane/Projects/Lambda/test/layout/data/css2.1/html4/support/ahem3.ttf') format('truetype');
    font-weight: normal;
    font-style: normal;
}

.control { display: inline; font: 1em/1 Ahem, sans-serif; background: red; color: white; }
div { font: 1em/1 Ahem, monospace; color: navy; }
.bn { white-space: normal; }
.bp { white-space: pre; }
